import React from 'react';
import { useHistory } from 'react-router-dom';

function Loginpage() {
    let history = useHistory();
    return (
      <div>
        <h1>LOGIN</h1> 
        <button onClick={()=>history.pushState('/')}>Back Home</button>
      </div>
    );
  }
  
  export default Loginpage;
